import React from 'react';
import { Plus } from 'lucide-react';

const AddTrapButton = ({ onClick, className }) => {
  return (
    <button
      onClick={onClick}
      className={`bg-green-600 hover:bg-green-700 text-white px-6 py-3 rounded-lg flex items-center gap-2 transition-colors ${className}`}
    >
      <Plus className="w-5 h-5" />
      เพิ่มกับดักใหม่
    </button>
  );
};

export default AddTrapButton;
